import React from 'react'
import Nav from '../components/nav'
import CardProfile from '../components/layout/cardCover'
import '../styles/base.scss'

class Home extends React.Component {

  constructor(props){
    super(props);

  }

  render() {
    return (
      <div>
        <Nav />
        <CardProfile
          avatar = "/static/cover.png"
          name = "cover"
        />

      </div>
    )
  }
}
export default Home
